var tipuesearch = {"pages":[{"title":"About","text":"CMSimfly 內容管理網誌 課程倉儲: https://github.com/40923221/cd2022 內容管理: https://chiamingyen.github.io/cmsimfly/ 課程投影片: https://chiamingyen.github.io/cmsimfly/reveal 課程網誌: https://chiamingyen.github.io/cmsimfly/blog","tags":"misc","url":"./pages/about/"},{"title":"w13 online","text":"w13 online 線上教學 5/19 STL https://40923221.github.io/cd2022/content/STL.html XML https://40923221.github.io/cd2022/content/XML.html 控制碼 https://40923221.github.io/cd2022/content/%E6%8E%A7%E5%88%B6%E7%A2%BC.html 心得 在繪製NX時遇到諸多問題，如不確定零件尺寸，原先想說乍看之下類似就好了，但是因為孔距的不一而在組裝上有干涉的情形出現，後來將CoppeliaSim的圖檔匯出一一測量後再繪製出來，而程式碼的問題XML有解答，只需將內部的檔案名稱做更動就可以正常運作了。","tags":"Misc","url":"./online.html"},{"title":"協同產品設計w10_block_ui","text":"請各組員在下列影片中加入註解說明後, 分別以 w10_block_ui、w10_nx_integ 與 w10_ssh 作為標題, 將說明影片嵌入個人 cd2022 網站頁面 (設為 H2 或 H3) 及 blog 網誌中. 影片 https://40923221.github.io/cd2022/downloads/w10_block_ui.mp4","tags":"Misc","url":"./w10_block_ui.html"},{"title":"協同產品設計w10_nx_integ","text":"請各組員在下列影片中加入註解說明後, 分別以 w10_block_ui、w10_nx_integ 與 w10_ssh 作為標題, 將說明影片嵌入個人 cd2022 網站頁面 (設為 H2 或 H3) 及 blog 網誌中. 影片 https://40923221.github.io/cd2022/downloads/w10_nx_integ.mp4","tags":"Misc","url":"./w10_nx_integ.html"},{"title":"協同產品設計w10_ssh","text":"請各組員在下列影片中加入註解說明後, 分別以 w10_block_ui、w10_nx_integ 與 w10_ssh 作為標題, 將說明影片嵌入個人 cd2022 網站頁面 (設為 H2 或 H3) 及 blog 網誌中. 影片 https://40923221.github.io/cd2022/downloads/w10_ssh.mp4","tags":"Misc","url":"./w10_ssh.html"},{"title":"協同產品設計w8","text":"2022協同產品設計實習w8 內容 w8的部分為將uram手臂放入coppeliasim去模擬並使用UI介面去控制網站 分配到的零件(29~~35) 流程 依照分配到的零件去畫出來wink在 零件繪製 再來丟進coppeliasim模擬，過程都在上面的連結了 心得 上次有摸索過相關的3D繪圖程式了，所以這次問題不大，只是需要的思考一下如何正確繪製。","tags":"Misc","url":"./midterm.html"},{"title":"W7","text":"2022協同產品設計實習 工作分配進度 LEO Leo （L eonine E ditor with O utlines）是一個開源 文本編輯器/大綱工具，它以克隆（大綱節點的虛擬副本）為特色，作為組織、導航、定制和腳本編寫的中心工具。","tags":"Misc","url":"./w7_summary.html"},{"title":"2022 Spring CD 課程","text":"2020 Fall 計算機程式的教學主要介紹 Python 與 Flutter 在機械設計流程中的應用. NX1980 來自 Siemens PLM Software 的[ NX™] 產品開發解決方案內建先進的效能與尖端技術，可協助您充分掌控開發複雜性並具備全球競爭力 NX 支援從概念設計到工程與製造的每個產品開發層面，以整合式工具組協調各個專業領域的合作、保留資料完整性與設計理念，同時簡化整個流程。 NX 具備業界範圍最廣、威力最強大且整合度最佳的應用程式套件，協助您做出更明智的決策並以最高效率提供更優質的產品，是您生產力的最佳幫手。 NX 不只內建電腦輔助設計、工程與製造工具組 (CAD/CAM/CAE)，還可將資料管理、流程自動化、決策支援與其他有助您完善開發流程的各項工具整合起來，藉此促進設計人員、工程師以及整個組織間的協同作業效率。 Solvespace [SolveSpace]是一款免費的開源2D/ 3D 基於約束的參數化 計算機輔助設計(CAD) 軟件，支持基本的2D和 3D建模。 它是一個基於約束的參數化建模器，具有簡單的機械仿真功能。2.1 及更高版本可在 Windows、Linux 和 macOS 上運行。Linux 版本作為snap包和本機包提供。它支持STEP和DFX的導入和導出。默認情況下，SolveSpace 使用自己的 CAD 文件格式.slvs來存儲模型。可以將模型整體或部分導出為各種格式，例如PDF、SVG或Encapsulated PostScript (EPS)。 它最初由 Jonathan Westhues 創建，截至 2022 年由志願者社區維護。 Onshape [Onshape]是一個計算機輔助設計( CAD )軟件系統，通過軟件即服務( SAAS ) 模型通過 Internet 交付。它廣泛使用雲計算，在基於Internet的服務器上執行計算密集型處理和渲染，用戶可以通過Web 瀏覽器或iOS和Android應用程序與系統進行交互。作為一個 SAAS 系統，Onshape 升級直接發佈到 Web 界面，軟件不需要用戶進行維護工作。 Onshape 允許團隊在單個共享設計上進行協作，就像多個作者可以通過雲服務一起編輯共享文檔一樣。它主要專注於機械 CAD ( MCAD )，用於許多行業的產品和機械設計​​，包括消費電子、機械機械、醫療設備、3D 打印、機器零件和工業設備。 [Onshape]https://www.onshape.com/en/ [SolveSpace]https://solvespace.com/index.pl","tags":"Misc","url":"./w6_40923221.html"}]};